import React from 'react';

const Spec = (properties) => {
    return(
        <tr>
          <td>{properties.header}</td>
          <td>{properties.text[0]}</td>
        </tr>
    )
}

const createPoints = (points) => {
  for(var i = 1; i < points.length; i++){
    return React.createElement('p', null, points[i]);
  }
}

export default Spec;
